import { StyleSheet, Button } from 'react-native';


//Colors
var lemon = "#EAE2B7";
var red = "#D62828";
var blue = "#003049";

export default StyleSheet.create({
    body: {
        flex: 2,
        backgroundColor: lemon,
        alignItems: 'center',
        justifyContent: 'center',
    },
    title: {
        color: red,
        fontSize: 42,
    },
    
    huntedButtons: {
        flex: 1,
        height: 0,
        width: 200,
        justifyContent: 'space-between',
        margin: 10,
    },
    text: {
        color: blue,
        fontSize: 30,
        margin: 10,
    },
    socialButton: {
        width: 100,
        height: 100,
    },
    input: {
        margin: 10,
        borderWidth: 2,
        borderRadius: 5,
    },
});
